import React, { Component, Fragment } from 'react';

class TodoList extends Component {
    // 构造函数,由于其他的函数先调用
    constructor(props) {
        super(props);
        // 定义这个组件的状态
        this.state = {
            inputValue: "我变了",
            list: []
        }
    }
    render() {
        return (
            <Fragment>
                <div>
                    <input value = {this.state.inputValue} onChange={this.handleInputChange}/>
                    <button>提交</button>
                </div>
                <ul>
                    <li>学英语</li>
                    <li>Learn React</li>
                </ul>
            </Fragment>
        )
    }

    handleInputChange(e){
        console.log(e.target.value);
        
    }
}

export default TodoList;
